    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def backtrack(num, target, op, res, path, idx):
            if idx == len(num):
                if target == 0 and op == '':
                    res.append(path)
                return
