                if i != idx and num[idx] == '0':
                    break
                cur = int(num[idx:i+1])
                if op == '':
                    backtrack(num, target - cur, num[idx:i+1], res, path + str(cur), i+1)
                else:
                    backtrack(num, target - cur, str(eval(op + '+' + str(cur))), res, path + '+' + str(cur), i+1)
                    backtrack(num, target - cur, str(eval(op + '-' + str(cur))), res, path + '-' + str(cur), i+1)
                    backtrack(num, target - cur, str(eval(op + '*' + str(cur))), res, path + '*' + str(cur), i+1)

